import React, { useEffect, useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faTwitter, faFacebook, faYoutube } from '@fortawesome/free-brands-svg-icons';
import { useParams } from 'react-router';
import './LeagueDetail.css';

const LeagueDetail = () => {
    const { leagueId } = useParams();
    const [league, setLeague] = useState([]);
    useEffect(() => {
        const url = `https://www.thesportsdb.com/api/v1/json/1/lookupleague.php?id=${leagueId}`;
        fetch(url)
            .then(res => res.json())
            .then(data => setLeague(data.leagues[0]))

    }, [leagueId]);
    //conditional gender rendering
    let genderChange;
    if (league.strGender === 'female') {
        genderChange = <img src=".data:image/jpeg;base64," alt="" />
    }
    else if (league.strGender === 'mixed') {
        genderChange = <img src=".data:image/jpeg;base64," alt="" />
    }
    else {
        genderChange = <img src="data:image/jpeg;base64," alt="" />
    }

    return (
        <div className="main-container">
            <div style={{ backgroundImage: `url(${league.strBanner})`, backgroundRepeat: 'no-repeat', backgroundSize: '100% 100%', }}>
                <div id="banner-logo">
                    <img src={league.strBadge} alt="" />
                </div>
            </div>
            <div className="container">
                <div className="bio-picture">
                    <div className="bio-container">
                        <h2>{league.strLeague}</h2>
                        <h4>Founded: {league.intFormedYear}</h4>
                        <h4>Country: {league.strCountry}</h4>
                        <h4>Sport Type: {league.strSport}</h4>
                        <h4>Gender: {league.strGender}</h4>
                    </div>
                    <div className="picture-container">
                        {genderChange}
                    </div>
                </div>
                <div>
                    {
                        league.strDescriptionEN
                    }
                </div>
            </div>
            <footer>
                <div className="footer-icon">
                    <a className="fa" target="_blank" rel="noreferrer" href={`https://${league.strTwitter}`}><FontAwesomeIcon icon={faTwitter} /></a>
                    <a className="fa" target="_blank" rel="noreferrer" href={`https://${league.strFacebook}`}><FontAwesomeIcon icon={faFacebook} /></a>
                    <a className="fa" target="_blank" rel="noreferrer" href={`https://${league.strYoutube}`}><FontAwesomeIcon icon={faYoutube} /></a>
                </div>
            </footer>
        </div>

    );
};

export default LeagueDetail;